import { urlFor } from '@ohrm/core/util/helper/url';
import { navigate } from '@/core/util/helper/navigation';
import { required } from '@/core/util/validation/rules';
import { OxdAlert } from '@ohrm/oxd';
export default {
  name: 'AdministratorAccess',
  components: {
    'oxd-alert': OxdAlert
  },
  props: {
    username: {
      type: String,
      required: true
    },
    error: {
      type: Object,
      default: () => null
    },
    token: {
      type: String,
      required: true
    },
    backUrl: {
      type: String,
      default: null
    }
  },
  data() {
    return {
      password: '',
      rules: {
        password: [required]
      },
      noteClasses: {
        'orangehrm-admin-access-note': true,
        '--padding': this.error === null
      },
      noteContainerClass: {
        'orangehrm-admin-access-note-container': this.error === null
      }
    };
  },
  computed: {
    submitUrl() {
      return urlFor('/auth/adminVerify');
    }
  },
  methods: {
    onSubmit() {
      this.$refs.verifyForm.$el.submit();
    },
    onCancel() {
      navigate(this.backUrl);
    }
  }
};
